import React from 'react';
import {View, Text, FlatList, StyleSheet} from 'react-native'

const ListScreen = () => {
    const users = [
        {key: 1, name: "Friend1"},
        {key: 2, name: "Friend2"},
        {key: 3, name: "Friend3"},
        {key: 4, name: "Friend4"},
        {key: 5, name: "Friend5"},
    ]
    return (
        <FlatList
            data={users} 
            renderItem={((item) => {
                return <Text>{item.name.toString()}</Text>
            })}
            keyExtractor={item => item.key.toString()}
        />
    )
}

export default ListScreen;
